import React, {useState} from 'react';
import Router from 'next/router'

import {Title, TipWrapper3} from "./../../Layouts/styledLayouts";
import {Text} from "../../StyledComponents/Text";
import {CheckboxWithLabel} from "../../controls/Checkbox/Checkbox";

const SuccessfulBookings = ({handleChangeStep}) => {
    const [checked, setCheck] = useState(false);

    return (
        <>
            <Title mb={35} >Successful bookings start with an accurate calendar</Title>

            <TipWrapper3 mt={40} mb={20} blue >
                <Text white fz={15} >
                    Regularly update information about your availability in the calendar so that other users could easily plan
                    their events and bookings. No more misunderstandings or hitches, now you won’t miss any opportunity.
                </Text>
            </TipWrapper3>

            <CheckboxWithLabel
                checked={checked}
                onChange={() => setCheck(!checked)}
                label="Got it! I’ll keep my calendar up to date."
                fz={16}
                blue
            />
        </>
    );
};

export default SuccessfulBookings;
